import { React, useState, useEffect } from 'react';
import data from '../data';
import Container from './container';

export default function Jobs() {

    const [jobs, setJobs] = useState([]); /* Store the jobs retrieved from Json Data MUST NEVER CHANGE DIRECTLY ONCE LOADED! */
    const [filters, setFilters] = useState([]); /* Store the taxlist of filters */
    const [filteredJobs, setFilteredJobs] = useState([]); /* Store the list of Jobs according to user filters */


    useEffect(()=>{
        setJobs(data);
    }, []);

    useEffect(()=>{
        setFilteredJobs(jobs);
    },[jobs]);

    useEffect(()=>{
        doFilter();
    }, [filters]);


    /* Filter functions */
    /* Add and remove elements in the filter list, apply doFilter() when updated, addFilter() first checks if the clicked element isn't already in the array */
    const addFilter = el => {
        !filters.includes(el) && setFilters(filters => [...filters, el]);
    }

    const removeFilter = el =>{
        setFilters(filters => filters.filter( elem =>{
            return elem != el;
        }));
    }

    /* run in the useEffect everytime the filters state changes */

    const doFilter = () => {
        setFilteredJobs(
            jobs.filter(item =>
              filters.every(filter =>
                [item.role, item.level, ...item.languages, ...item.tools].includes(filter)
              )
            )
          );
    } 

    /* reset everything */

    const clear = () =>{
        setFilters([]);
        setFilteredJobs(jobs);
    }

    return(
        <section className="jobs">
            <header>

            </header>
            <section className="filterList">
                <div className="filterList-tags">
                {filters.map(el=>{
                    return(
                        <h2>{el}<span onClick={e=>{removeFilter(el)}}>{" X"}</span></h2>
                    )
                })}
                </div>
                <span onClick={e=>{clear()}}>{"Clear all"}</span>
            </section>

            <section>
                {filteredJobs.map(item=>{
                    const arrTax = [item.role, item.level, ...item.languages, ...item.tools];
                    const arrMeta = [item.postedAt, item.contract, item.location];
                    return (
                        <section>
                        <Container
                        key= {index}
                    image = {photosnap}
                    company = {data[0].company}
                    new = 'NEW!'
                    featured = "FEATURED"
                    role = {data[0].role}
                    level = {data[0].level}
                    position = {data[0].position}
                    postedAt = {data[0].postedAt}
                    contract = {data[0].contract}
                    location = {data[0].location}
                    languages = {data[0].languages}
                    show = {show}
                     box = "box border"
                    />
                    <Container
                     key= {index}
                    image = {manage}
                    company = {data[1].company}
                    new = 'NEW!'
                    featured = ""
                    role = {data[1].role}
                    level = {data[1].level}
                    position = {data[1].position}
                    postedAt = {data[1].postedAt}
                    contract = {data[1].contract}
                    location = {data[1].location}
                    languages = {data[1].languages}
                    tools = {data[1].tools}
                    show = {show}
                    box = "box border"
                    />
                 <Container
                  key= {index}
                    image = {account}
                    company = {data[2].company}
                    new = ''
                    featured = ""
                    role = {data[2].role}
                    level = {data[2].level}
                    position = {data[2].position}
                    postedAt = {data[2].postedAt}
                    contract = {data[2].contract}
                    location = {data[2].location}
                    languages = {data[2].languages}
                    show = {show}
                    box = "box"
                    />
                     <Container
                      key= {index}
                    image = {myhome}
                    company = {data[3].company}
                    new = ''
                    featured = ""
                    role = {data[3].role}
                    level = {data[3].level}
                    position = {data[3].position}
                    postedAt = {data[3].postedAt}
                    contract = {data[3].contract}
                    location = {data[3].location}
                    languages = {data[3].languages}
                    show = {show}
                    box = "box"
                    />
                     <Container
                      key= {index}
                    image = {loop}
                    company = {data[4].company}
                    new = ''
                    featured = ""
                    role = {data[4].role}
                    level = {data[4].level}
                    position = {data[4].position}
                    postedAt = {data[4].postedAt}
                    contract = {data[4].contract}
                    location = {data[4].location}
                    languages = {data[4].languages}
                    show = {show}
                    box = "box"
                    />
                     <Container
                     
                    image = {faceit}
                    company = {data[5].company}
                    new = ''
                    featured = ""
                    role = {data[5].role}
                    level = {data[5].level}
                    position = {data[5].position}
                    postedAt = {data[5].postedAt}
                    contract = {data[5].contract}
                    location = {data[5].location}
                    languages = {data[5].languages}
                    show = {show}
                    box = "box"
                    />
                     <Container
                    image = {shortly}
                    company = {data[6].company}
                    new = ''
                    featured = ""
                    role = {data[6].role}
                    level = {data[6].level}
                    position = {data[6].position}
                    postedAt = {data[6].postedAt}
                    contract = {data[6].contract}
                    location = {data[6].location}
                    languages = {data[6].languages}
                    show = {show}
                    box = "box"
                    />
                     <Container
                    image = {insure}
                    company = {data[7].company}
                    new = ''
                    featured = ""
                    role = {data[7].role}
                    level = {data[7].level}
                    position = {data[7].position}
                    postedAt = {data[7].postedAt}
                    contract = {data[7].contract}
                    location = {data[7].location}
                    languages = {data[7].languages}
                    show = {show}
                    box = "box"
                    />
                     <Container
                    image = {eyecam}
                    company = {data[8].company}
                    new = ''
                    featured = ""
                    role = {data[8].role}
                    level = {data[8].level}
                    position = {data[8].position}
                    postedAt = {data[8].postedAt}
                    contract = {data[8].contract}
                    location = {data[8].location}
                    languages = {data[8].languages}
                    show = {show}
                    box = "box"
                    />
                     <Container
                    image = {air}
                    company = {data[9].company}
                    new = ''
                    featured = ''
                    role = {data[9].role}
                    level = {data[9].level}
                    position = {data[9].position}
                    postedAt = {data[9].postedAt}
                    contract = {data[9].contract}
                    location = {data[9].location}
                    languages = {data[9].languages}
                    show = {show}
                    box = "box"
                    /> 
                     </section>
                    )
                })}
            </section>
        </section>
    )
}
